// Modal functionality for showing project details
const modal = document.getElementById('project-modal');
const modalContent = document.querySelector('.modal-content');
const modalTitle = document.getElementById('modal-title');
const modalDescription = document.getElementById('modal-description');



document.querySelectorAll('.project-btn').forEach(button => {
    button.addEventListener('click', function() {
        const projectName = this.textContent.trim();  // Get project name from button text
        const projectData = projectsData[projectName];
        
        if (projectData) {
            modalTitle.textContent = projectName;

            // Create content layout using HTML for description
            modalDescription.innerHTML = `
                <h3>${projectName} Overview</h3>
                <p>${projectData.overview}</p>
                <h4>Features</h4>
                <ul>
                    ${projectData.features.map(feature => `<li>${feature}</li>`).join('')}
                </ul>
                <h4>Technologies Used</h4>
                <ul>
                    ${projectData.technologies.map(tech => `<li>${tech}</li>`).join('')}
                </ul>
                <p>Click the link below to see the project details or demo:</p>
                <img src="${projectData.img_path}" alt="${projectName}">
                <img src="${projectData.img_path_2}" alt="${projectName}">
                <p>${projectData.Additional}</p>
                <a href="${projectData.link}" class="btn" target="_blank">View Project Demo</a>
            `;
            modal.classList.add('active');
        } else {
            modalDescription.innerHTML = `<p>No data available for this project.</p>`;
        }
    });
});
// Close the modal when clicking on the close button
document.querySelector('.modal-close').addEventListener('click', () => {
    closeModal();
});

// Close the modal when clicking outside the modal content
window.addEventListener('click', function (e) {
    if (e.target === modal && !modalContent.contains(e.target)) {
        closeModal();
    }
});

// Close the modal function
function closeModal() {
    modal.classList.remove('active');
    modal.classList.add('inactive');

    // Wait for animation to finish before hiding
    setTimeout(() => {
        modal.classList.remove('inactive');
    }, 400);
}
